INSERT INTO `problems` VALUES (1001,'Hello World!','\"Hello Tmt World XD!\"','TIOJ1001','2014-08-12 06:43:46','2014-08-12 06:43:46','Input','Hello Tmt World XD!','//No Input','Hello Tmt World XD!','C/C++\r\n<ul><li>1</li>\r\n<li>system</li>\r\n<li>long long%I64d</li></ul>',0,0,NULL,NULL,1001),(1002,'A+B Problem','Calculate $a+b$ \r\n\r\n','TIOJ1002','2014-08-12 06:45:10','2014-08-12 07:19:33','Two integer $a, b$ $(0\\le a, b\\le 10)$\r\n\r\n','Output $a+b$\r\n\r\n','1 2\r\n','3','Q: Where are the input and the output?\r\n\r\nA: Your program shall always <font color=red>read input from stdin (Standard Input) and write output to stdout (Standard Output)</font>. For example, you can use \'scanf\' in C or \'cin\' in C++ to read from stdin, and use \'printf\' in C or \'cout\' in C++ to write to stdout.\r\n\r\nYou <font color=red>shall not output any extra data</font> to standard output other than that required by the problem, otherwise you will get a \"Wrong Answer\".\r\n\r\nUser programs are not allowed to open and read from/write to files. You will get a \"Runtime Error\" or a \"Wrong Answer\" if you try to do so. \r\n\r\nHere is a sample solution for problem 1000 using C++/G++:\r\n<pre>\r\n#include &lt;iostream>\r\nusing namespace std;\r\nint  main()\r\n{\r\n    int a,b;\r\n    cin >> a >> b;\r\n    cout << a+b << endl;\r\n    return 0;\r\n}</pre>\r\nIt\'s important that the return type of main() must be int when you use G++/GCC,or you may get compile error.\r\n\r\nHere is a sample solution for problem 1000 using C/GCC:\r\n<pre>\r\n#include &lt;stdio.h>\r\n\r\nint main()\r\n{\r\n    int a,b;\r\n    scanf(\"%d %d\",&a, &b);\r\n    printf(\"%d\\n\",a+b);\r\n    return 0;\r\n}</pre>\r\nHere is a sample solution for problem 1000 using PASCAL:\r\n<pre>\r\nprogram p1000(Input,Output); \r\nvar \r\n  a,b:Integer; \r\nbegin \r\n   Readln(a,b); \r\n   Writeln(a+b); \r\nend.</pre>\r\nHere is a sample solution for problem 1000 using JAVA:\r\n\r\nNow java compiler is jdk 1.5, next is program for 1000\r\n<pre>\r\nimport java.io.*;\r\nimport java.util.*;\r\npublic class Main\r\n{\r\n            public static void main(String args[]) throws Exception\r\n            {\r\n                    Scanner cin=new Scanner(System.in);\r\n                    int a=cin.nextInt(),b=cin.nextInt();\r\n                    System.out.println(a+b);\r\n            }\r\n}</pre>\r\nOld program for jdk 1.4\r\n<pre>\r\nimport java.io.*;\r\nimport java.util.*;\r\n\r\npublic class Main\r\n{\r\n    public static void main (String args[]) throws Exception\r\n    {\r\n        BufferedReader stdin = \r\n            new BufferedReader(\r\n                new InputStreamReader(System.in));\r\n\r\n        String line = stdin.readLine();\r\n        StringTokenizer st = new StringTokenizer(line);\r\n        int a = Integer.parseInt(st.nextToken());\r\n        int b = Integer.parseInt(st.nextToken());\r\n        System.out.println(a+b);\r\n    }\r\n}</pre>',0,0,NULL,NULL,1002),(1003,'','\r\n\r\n(Problem 1003, Problem 1004)\r\n\r\n 16  4  7  $n$  $f(n)$  $n$  $f(0)=1$\r\n\r\n','TIOJ1003 / 95(1, recursive-a)','2014-08-12 06:45:57','2014-08-12 07:21:20',' $n$ $(1\\le n \\le 50)$',' $f(n)$ ','3','7',' 7 \r\n\r\n',0,0,NULL,NULL,1003),(1004,'','4141123441n\r\n\r\n $f(n)$  $f(1)=1$ $2n$ \r\n\r\n$1, 3, 5, \\cdots, 2i-1, \\cdots, 2n-3, 2n-1$ (1)\r\n\r\n $1$  $n$  $i \\rightarrow 2i-1$\r\n\r\n$1, 2, 3, \\cdots, i, \\cdots, n-1, n$ (1)\r\n','TIOJ1004 / 95(1, recursive-b)','2014-08-12 06:45:58','2014-08-12 07:24:09',' $n$ $(1\\le n\\le 50)$',' $f(n)$ ','41','19','',0,0,NULL,NULL,1004),(1005,'','Robert A.J. MatthewsPiPi\r\n\r\n221:\r\n\r\n<img src=\"http://acm.uva.es/p/v4/412img2.gif\">\r\n\r\n{2,3,4,5,6}10(2,3), (2,5), (3,4), (3,5), (4,5), (5,6)6\r\n\r\n<img src=\"http://acm.uva.es/p/v4/412img3.gif\">\r\n\r\n\r\nPi\r\n','TIOJ1005 / 95(2, pi)','2014-08-12 06:45:58','2014-08-12 06:45:58','N1 < N < 50N032768\r\n\r\nN=0Sample Input\r\n','Pi6No estimate for this data set.\r\n\r\nSample Output\r\