nt</b> Guess(<b>const char</b> str[], <b>int</b> len): (1 or 0)strlenstr</li>\r\n<li><b>void</b> Report(<b>const char</b> str[]): </li>\r\n</ul></font>\r\nGuess1/32768\r\n','TIOJ1262 / (prob E)Adapt from','2014-08-12 06:49:28','2014-08-12 10:01:15','Initialize()','Report()printf/puts/fwrite/putchar/fputs/fputc/cout...','7289\r\n473\r\n226\r\n4310\r\n23936\r\n843\r\n23947\r\n5934\r\n2304\r\n2328\r\n34854\r\n23941\r\n394\r\n6869','tioj\r\n','WA\r\n\\#include \"lib1262.h\"\r\n\r\nint main()\r\n{\r\n  Initialize();\r\n  Report(Guess(\"acm\",3)?\"acm\":\"tioj\");\r\n  return 0;\r\n}\r\nstdio.h, stdlib.h, string.h, time.hinclude1262_word.h\r\n<a href=\"http://w.csie.org/~b98902114/1262_word.zip\"></a>TIOJ-<a href=\"http://tmtacm.no-ip.org/JudgeOnline/showproblem?problem_id=1087\">1087</a>',0,2,NULL,'#include<stdio.h>\r\n#include<stdlib.h>\r\n#include<string.h>\r\n#include<time.h>\r\n\r\nint _Secret_Table[16]={458,234,4312,23945,347,129,248,4375,298,534,85,120,48,4,38,56};\r\nint _Real_Length; char _RRSS[100];\r\n\r\nvoid _akira_encode(const char str[])\r\n{\r\n	int len,ptr;\r\n	len=strlen(str);\r\n	printf(\"%d\\n\",len^7293);\r\n	for(ptr=0;ptr<len;ptr++)printf(\"%d\\n\",((str[ptr]-\'a\')^_Secret_Table[ptr&15]));\r\n}\r\n\r\nvoid Initialize()\r\n{\r\n	int ptr,tmp; time_t t;\r\n	scanf(\"%d\",&_Real_Length);\r\n	_Real_Length^=7293;\r\n	for(ptr=0;ptr<_Real_Length;ptr++)\r\n	{\r\n		scanf(\"%d\",&tmp);\r\n		_RRSS[ptr]=(tmp^_Secret_Table[ptr&15])+\'a\';\r\n	}\r\n	time(&t);\r\n	srand(t);\r\n}\r\n\r\nint Guess(const char str[],int len)\r\n{\r\n	int i,j,result;\r\n	result=0;\r\n	if(len<=_Real_Length)\r\n	{\r\n		for(i=0;i+len<=_Real_Length;i++)\r\n		{\r\n			for(j=0;j<len;j++)if(str[j]!=_RRSS[i+j])break;\r\n			if(j==len){result=1;break;}\r\n		}\r\n	}\r\n	return(rand()?result:!result);\r\n}\r\n\r\nvoid Report(const char str[])\r\n{\r\n	puts(str);\r\n	exit(0);\r\n}',1262),(1263,'','<script type=\"text/javascript\" src=\"LaTeXMathML.js\"></script></body><head><link rel=\"stylesheet\" type=\"text/css\" href=\"LaTeXMathML.standardarticle.css\" /> </head><body>$K$ $N$ \r\n$K$<b></b>','TIOJ1263 / Bulgarian National Olympiad in Informatics 2008 Final (Prob A2)','2014-08-12 06:49:29','2014-08-12 06:49:29',' $N, K$, $(0 &lt; N &lt; 50, 0 &lt; K&lt; 11)$\r\n$N$$9999$','$K$<b></b> $0$','4 3\r\n0 0\r\n1 1\r\n0 10\r\n10 0\r\n','5','',0,0,NULL,NULL,1263),(1264,'','<script type=\"text/javascript\" src=\"LaTeXMathML.js\"></script></body><head><link rel=\"stylesheet\" type=\"text/css\" href=\"LaTeXMathML.standardarticle.css\" /> </head><body> $n \\times k$ ','TIOJ1264 / Bulgarian National Olympiad in Informatics 2008 Final (Prob A3)','2014-08-12 06:49:30','2014-08-12 06:49:30',' $n,k$, $(0 &lt; n &lt; 500, 0 &lt; k &lt; 32)$','','2 2','4','',0,0,NULL,NULL,1264),(1265,'','<script type=\"text/javascript\" src=\"LaTeXMathML.js\"></script></body><head><link rel=\"stylesheet\" type=\"text/css\" href=\"LaTeXMathML.standardarticle.css\" /> </head><body>(table)\r\n\r\n<center><img src=\"pimgs/1265_1.gif\"></center>\r\n\r\n','TIOJ1265 / Bulgarian National Olympiad in Informatics 2008 Final (Prob A4)','2014-08-12 06:49:33','2014-08-12 06:49:33','\r\n50','','6 3 1 7 9 11 12 10 2 4 5 8\r\n6 12 18 24 30 36 42 48 54 59 60 61\r\n','40320\r\n0','',0,0,NULL,NULL,1265),(1266,'','Peter Hacker\"VerhShifr\"\r\n\r\n\r\n\r\n()\r\n\r\nPeter\r\n\r\n\r\n\r\n\r\n<script type=\"text/javascript\" src=\"LaTeXMathML.js\"></script></body><head><link rel=\"stylesheet\" type=\"text/css\" href=\"LaTeXMathML.standardarticle.css\" /> </head><body>\r\nAfter wining every informatics competition in the world, Peter the Hacker decided to try a different type of challenge. He registered in the Russian web site for online competitions in cryptography and locksmith VerhShifr and soon he has arrived in Moscow, participating in the finals.\r\nDuring one of the excursions that the organizers prepared, the group visited a large museum for Matryoshka dolls  traditional Russian nested toys. Inside the museum, there was a strange labyrinth. Its rooms and the labyrinth itself were squares and their walls were parallel to the north-south and east-west axes. Each chamber had four doors  one on each side. The entrance to the labyrinth was in the most northwestern room and the exit  in the most southeastern.\r\nThe Russian national team in ciphers prepared an interesting game for their opponents. In each room, they left a single empty Matryoshka doll with unique size. Everyone had to go through the labyrinth and collect as many toys as possible but under one condition. Every time someone picks a doll, he has to nest all the dolls he has into the new one. Of course, the contestants could decide whether to pick a Matryoshka (if it is bigger than the last one) or to continue to the next room. To make things even harder, the genius of the safes  Metr Pitrichev  had modified the doors so that from a room one can move only to the rooms to the south and to the east.\r\nPeter, of course, was not such a master with the locks and could not deal with the modification. Instead, he wrote a program, which can find the best way to collect as many toys as possible. Can you do that, too? Write a program <b>matr</b> that calculates the maximum amount of Matryoshka dolls, which Peter the Hacker can collect for a given configuration of rooms.\r\n','TIOJ1266 / Bulgarian National Olympiad in Informatics 2008 Final (Prob A5)','2014-08-12 06:49:34','2014-08-12 06:49:34','N1<N<1000)N*N()\r\n1n^2\r\n\r\nOn the standard input you will get a single integer $N$ $(1 &lt; N &lt; 1000)$, followed by $N$ rows with $N$ numbers (one for each room). Every number describes the size of the toy inside the corresponding chamber. The rows are ordered from north to south (the first row is the most northern) and the columns are ordered from west to east (the first number on every row is the most western). A Matryoshka doll fits into another if it has smaller size than the second one. The sizes will be integer numbers in $[1, N^2]$ and will not repeat.','\r\n\r\nOn the standard output, you should print a single integer  the maximum amount of toys that Peter the Hacker can collect following the rules.','<h3>Sample Input #1:</h3>3\r\n9 4 1\r\n6 5 7\r\n2 3 8\r\n<h3>Sample Input #2:</h3>4\r\n1 15 4 5\r\n2 10 9 16\r\n14 7 8 3\r\n13 6 11 12\r\n','<h3>Sample Output #1:</h3>4\r\n<h3>Sample Output #2:</h3>6','\r\n$N^2$$N\\times N$$1$$N^2$()()()\r\n\r\n$9\\rightarrow 4\\rightarrow 5\\rightarrow 7\\rightarrow 8$$4,5,7,8$\r\n$1\\rightarrow 2\\rightarrow 10\\rightarrow 7\\rightarrow 8\\rightarrow 11\\rightarrow 12$$1,2,7,8,11,12$\r\n\r\n2009/02/21  by hallogameboy ,  math120908',0,0,NULL,NULL,1266),(1267,'','<script type=\"text/javascript\" src=\"LaTeXMathML.js\"></script></body><head><link rel=\"stylesheet\" type=\"text/css\" href=\"LaTeXMathML.standardarticle.css\" /> </head><body>  $N$  $x_1, x_2, , x_N$  $N$  $N=3$ $x_1+x_2+x_3$  $x_1x_2+x_2x_3+x_3x_1$ $3x_1x_2+2x_2x_3+3x_1x_3+x_2x_3$  $x_1x_2$  $N=2$  $N=3$ ','TIOJ1267 / Bulgarian National Olympiad in Informatics 2008 Final (Prob A6)','2014-08-12 06:49:39','2014-08-12 06:49:39','$K (0&lt;K&lt;21)$()$K$\r\n$N,M(0&lt;N&lt;20,0&lt;M&lt;9999)$\r\n$M$$N+1$$N$\r\n\r\n $-99$  $99$ $5$','$K$0-1$i$$1$$i$$0$','2\r\n3 1\r\n1 1 1 0\r\n3 4\r\n3 1 1 0\r\n2 0 1 1\r\n3 1 0 1\r\n1 0 1 1\r\n','01','',0,0,NULL,NULL,1267),(1268,'','<a href=\"http://contest.inoi.ir/user.phtml/jayen.pdf?op=get&id=640\"></a>m(_ _)m<script type=\"text/javascript\" src=\"LaTeXMathML.js\"></script></body><head><link rel=\"stylesheet\" type=\"text/css\" href=\"LaTeXMathML.standardarticle.css\" /> </head><body>\r\n\r\n$n$(board of directors)$n$\r\n\r\n$1$$n$$n$$\\pi$$i$$\\pi_i$$\\pi_i-1$$i$$\\pi_i$\r\n\r\n$n$($0$)$n$()\r\n\r\n','TIOJ1268 / INOI 2008(Round 1)','2014-08-12 06:49:41','2014-08-12 06:49:41','','','','','',2,0,NULL,NULL,1268),(1269,'Killall','\r\n\r\n<a href=\"http://contest.inoi.ir/user.phtml/killallen.pdf?op=get&id=642\"></a>','TIOJ1269 / INOI 2008','2014-08-12 06:49:41'