erminProgram(\"deny calling function SetNumberOfDefinition.\\n\");\r\n		else{\r\n			if(n<1 || n>20)\r\n				DeterminProgram(\"unavailable range in setting number of defination in function SetNumberOfDefinition.\\n\");\r\n			else{\r\n				TMTdmany=n;\r\n				TMTfocus=1;\r\n				TMTnow_state=STATE_SET_DEFINITIONS;\r\n			}\r\n		}\r\n	}\r\n\r\n	void SetDefinition(const char seed,const char grow[]){\r\n		if(TMTnow_state!=STATE_SET_DEFINITIONS)\r\n			DeterminProgram(\"deny calling function SetDefinition.\\n\");\r\n		else{\r\n			if(seed<\'A\' || seed>\'Z\')\r\n				DeterminProgram(\"unvavailable seed name in function SetDefinition.\\n\");\r\n			else{\r\n				int tlen=strlen(grow);\r\n				if(strlen(grow)==0)\r\n					DeterminProgram(\"couldn\'t get any seed or letter in function SetDefinition.\\n\");\r\n				else if(strlen(grow)>10)\r\n					DeterminProgram(\"length of growing exceed in function SetDefinition.\\n\");\r\n				else{\r\n					if(strcmp(grow,\"#\")==0){\r\n						TMTseed[TMTfocus]=seed;\r\n						strcpy(TMTgrow_words[TMTfocus],\"\");\r\n					}\r\n					else{\r\n						int count=0;\r\n						int i;\r\n						for(i=0;i<tlen;i++)\r\n							if( (\'A\'<=grow[i] && grow[i]<=\'Z\') || grow[i]==\'a\' || grow[i]==\'b\')\r\n								count++;\r\n						if(count!=tlen)\r\n							DeterminProgram(\"unknown letter in growing word in function SetDefinition.\\n\");\r\n						TMTseed[TMTfocus]=seed;\r\n						strcpy(TMTgrow_words[TMTfocus],grow);\r\n					}\r\n				}\r\n\r\n				TMTgrow_len[TMTfocus]=strlen(TMTgrow_words[TMTfocus]);\r\n				TMTfocus++;\r\n				if(TMTfocus>TMTdmany)\r\n					TMTnow_state=STATE_SET_START_SEED;\r\n			}\r\n		}\r\n	}\r\n\r\n	void SetStartSeed(const char seed){\r\n		if(TMTnow_state!=STATE_SET_START_SEED)\r\n			DeterminProgram(\"deny calling function SetStartSeed.\\n\");\r\n		else{\r\n			if(seed<\'A\' || seed>\'Z\')\r\n				DeterminProgram(\"unavailable seed name in function SetStartSeed.\\n\");\r\n			else{\r\n				TMTstart_seed=seed;\r\n				TMTnow_state=STATE_GET_SENTENCE;\r\n			}\r\n		}\r\n	}\r\n\r\n	int GetSentence(char re[]){\r\n		if(TMTnow_state!=STATE_GET_SENTENCE)\r\n			DeterminProgram(\"deny calling function GetSentence.\\n\");\r\n		else{\r\n			if(scanf(\"%s\",TMTnow_problem)==EOF){\r\n				Exam_b_More_Than_a();\r\n				TMTnow_state=STATE_END_OF_INPUT;\r\n				return 0;\r\n			}\r\n			else{\r\n				strcpy(re,TMTnow_problem);\r\n				TMTnow_word[0]=TMTstart_seed;\r\n				TMTnow_len=1;\r\n				TMTsubmit_time=0;\r\n				TMTnow_state=STATE_WAITING_ANSWER;\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n\r\n	void Grow(int position,int dno){\r\n		if(TMTnow_state!=STATE_WAITING_ANSWER)\r\n			DeterminProgram(\"deny calling function Grow.\\n\");\r\n		else{\r\n			if(position<0 || position>=TMTnow_len)\r\n				DeterminProgram(\"unavailable position in function Grow.\\n\");\r\n			else if(dno<1 || dno>TMTdmany)\r\n				DeterminProgram(\"unavailable definition number in function Grow.\\n\");\r\n			else if(TMTnow_word[position]<\'A\' || TMTnow_word[position]>\'Z\')\r\n				DeterminProgram(\"there is no seed at specified position in function Grow.\\n\");\r\n			else if(TMTnow_word[position]!=TMTseed[dno])\r\n				DeterminProgram(\"the seed in definition does not match the seed at specified position in function Grow.\\n\");\r\n			else if(TMTsubmit_time>=300)\r\n				DeterminProgram(\"calling function Grow more than 300 times in one sentence.  function denied.\\n\");\r\n			else{\r\n				int add_len=TMTgrow_len[dno]-1;\r\n				int next_len=TMTnow_len+add_len;\r\n				if(next_len>WORD_MAX_LENGTH)\r\n					DeterminProgram(\"Wrong Answer!!\\n\");\r\n				else{\r\n					if(add_len==0)\r\n						TMTnow_word[position]=TMTgrow_words[dno][0];\r\n					else{\r\n						int i;\r\n						if(add_len<0){\r\n							for(i=position+1;i<TMTnow_len;i++)\r\n								TMTnow_word[i-1]=TMTnow_word[i];\r\n						}\r\n						else{\r\n							for(i=TMTnow_len-1;i>position;i--)\r\n								TMTnow_word[i+add_len]=TMTnow_word[i];\r\n							for(i=0;i<TMTgrow_len[dno];i++)\r\n								TMTnow_word[position+i]=TMTgrow_words[dno][i];\r\n						}\r\n					}\r\n				}\r\n				TMTnow_len=next_len;\r\n				TMTsubmit_time++;\r\n#ifdef DEBUG\r\n				printf(\"debug mode:  pos=%d,  dno=%d  ==> \",position,dno);\r\n				for(int i=0;i<TMTnow_len;i++)\r\n					printf(\"%c\",TMTnow_word[i]);\r\n				printf(\"  (length=%d)\\n\",TMTnow_len);\r\n#endif\r\n			}\r\n		}\r\n	}\r\n\r\n	void ExamAnswer(){\r\n		if(TMTnow_state!=STATE_WAITING_ANSWER)\r\n			DeterminProgram(\"deny calling function ExamAnswer.\\n\");\r\n		else{\r\n			if(TMTnow_len!=strlen(TMTnow_problem))\r\n				DeterminProgram(\"Wrong Answer!!\\n\");\r\n			else{\r\n				int count=0;\r\n				int i;\r\n				for(i=0;i<TMTnow_len;i++)\r\n					if(TMTnow_problem[i]==TMTnow_word[i])\r\n						count++;\r\n				if(count==TMTnow_len)\r\n					printf(\"Accepted!!\\n\");\r\n				else\r\n					DeterminProgram(\"Wrong Answer!!\\n\");\r\n				TMTnow_state=STATE_GET_SENTENCE;\r\n			}\r\n		}\r\n	}\r\n\r\nint calc_key(int info[]){\r\n	int i;\r\n	long long int re=0;\r\n	for(i=0;i<28;i++)\r\n		re+=(long long int)info[i]*TMTkey[i];\r\n	return re%99991;\r\n}\r\n\r\ninline int dfs_exam(int level,int info[]){\r\n	if(level<500){\r\n		int no=calc_key(info);\r\n		if(TMThash[no]==0){\r\n			int count=0;\r\n			int times=0;\r\n			int i,j;\r\n			int list[26];\r\n			int tr;\r\n			int tcseed;\r\n			int tdno;\r\n#ifdef DEBUG\r\n			for(i=0;i<28;i++){\r\n				if(i==26)\r\n					printf(\" \");\r\n				printf(\"%d\",info[i]);\r\n			}\r\n			printf(\"\\n\");\r\n#endif\r\n			TMThash[no]=1;\r\n			for(i=0;i<26;i++)\r\n				if(info[i]>0){\r\n					list[count]=i;\r\n					count++;\r\n					times+=TMTseed_related_dmany[i];\r\n				}\r\n			if(count==0){\r\n				if(info[27]>=info[26])\r\n					return 0;\r\n			}\r\n			else{\r\n				for(i=0;i<times;i++){\r\n					tr=rand()%count;\r\n					tcseed=list[tr];\r\n					tr=rand()%TMTseed_related_dmany[tcseed];\r\n					tdno=TMTseed_related_dno[tcseed][tr];\r\n					for(j=0;j<28;j++)\r\n						info[j]+=TMTaction_detail[tdno][j];\r\n					info[tcseed]--;\r\n					if(dfs_exam(level+1,in