t how many ways to solve it, and output the alphabetically first solution.\r\n\r\nExample, \r\n1234\r\n4312\r\n2143\r\n3421\r\nis better than\r\n4321\r\n2134\r\n3412\r\n1243\r\n\r\nIf you solve this problem, you can say \"KUKUKU\" and have a nice day!!\r\n\r\n\r\n\r\n','TIOJ1581','2014-08-12 06:59:38','2014-08-12 06:59:38','There is four rows, and each row has four number,\r\nthe numbers means the numbers that are put on the small block already.\r\nIf the number is 0, it means the block is empty now, you should put the number on it.\r\n','Please count how many ways to solve it, and output the alphabetically first solution like Sample Output.\r\n\r\nAnd if there is no way to solve it, please output the message \"I can not solve!!\"(no double quotation marks)','1 2 3 4\r\n4 3 1 2\r\n2 1 4 3\r\n3 4 2 0','1234\r\n4312\r\n2143\r\n3421\r\n\r\nWe have 1 way(s) to solve it!!\r\n','',0,0,NULL,NULL,1581),(1582,'A TRIVIAL physical problem','Have you ever heard the lesson called \"WhileCome Physics\"?\r\n\r\nThe lesson is too hard to understand.\r\nYou will find the velocity of free fall with buoyancy and calculus.\r\nIT\'S SO TERRIBLE!!!\r\n\r\nBut the problem we will solve today is such a TRIVIAL problem.\r\n\r\nNow you have a polynomial function of velocity,\r\nthe only one mission you should solve is to find the function of acceleration!','TIOJ1582','2014-08-12 06:59:39','2014-08-12 06:59:39','The input is just a polynomial function of velocity.\r\nx means the only one variable in function.\r\nIf the exponentiation is 1, it just shows \"x\".\r\nIf the exponentiation is k, it just shows \"x^k\".\r\nif the term means a constant, it does not include \"x\".\r\nPS.\r\neach of the exponentiation just appears one time.\r\nAll of numbers are <font color=\"red\"><b>integer</b></font>.\r\n','Please output the function of the acceleration.\r\nAnd output it with decreasing exponentiation.','3x^5+4x^3+3x+5-5x^-2+5x^-3\r\n','15x^4+12x^2+3+10x^-3-15x^-4\r\n','',0,0,NULL,NULL,1582),(1583,'