b> color=0color=1\r\n\r\niGet(0, x, y)ixy<b>WA</b>\r\n\r\n\r\n<b>void Report(int color, int n1, int n2);</b> color n1n2\r\n\r\nReport(1, 1, 2)12\r\n\r\n<b>void Finish(void);</b>\r\n\r\n\r\n\r\n\r\n\r\n3 &lt;= g,r &lt;= 50,000\r\n0 < s <= 200,000,000\r\n\r\n\r\n','TIOJ1631 / IOI \'06 Joining Points\r\nProblem SetterATP','2014-08-12 07:00:39','2014-08-12 10:28:09','WA\r\n\r\n','Report()Finish()\r\n\r\n','3      ()\r\n0 5\r\n5 5\r\n2 1\r\n3      ()\r\n0 0\r\n5 0\r\n3 4\r\n\r\n','Report(0, 1, 2);\r\nReport(0, 2, 3);\r\nReport(1, 1, 2);\r\nReport(1, 1, 3);\r\n\r\n','1.AC\r\n\\#include &lt;cstdio>\r\n\\#include \"lib1631.h\"\r\n\r\nint pos[2][50001][2];\r\nint cnt[2];\r\nint main(){\r\n&nbsp;Init(cnt[0], cnt[1]);\r\n&nbsp;for(int i=0; i&lt;=1; i++)\r\n&nbsp;&nbsp;for(int j=1; j&lt;=cnt[i]; j++)\r\n&nbsp;&nbsp;&nbsp;Get(i, pos[i][j][0], pos[i][j][1]);\r\n\r\n&nbsp;for(int i=0; i&lt;=1; i++)\r\n&nbsp;&nbsp;for(int j=1; j&lt;cnt[i]; j++)\r\n&nbsp;&nbsp;&nbsp;Report(i, j, j+1);\r\n&nbsp;Finish();\r\n}\r\n\r\n\r\njudge<font color=\"red\"></font><font color=\"red\"></font>\r\n\r\n\r\n',0,2,NULL,'//A Special Judge For IOI \'06 Joining Points\r\n//Author : poao899\r\n\r\n#ifndef __POINTS__\r\n#define __POINTS__\r\n#define POINT_NUM 50010\r\n\r\n#include <cstdio>\r\n#include <cstdlib>\r\n#include <cstring>\r\n#include <algorithm>\r\n#include <set>\r\n\r\nnamespace ioi06_points{\r\n\r\n	bool init;\r\n\r\n	int getCnt[2];\r\n\r\n	int num[2], pCnt, lineCnt;\r\n	int root[2][POINT_NUM];\r\n\r\n	int find(int c, int a){\r\n	//	printf(\"%d %d : %d\\n\", c, a, root[c][a]);\r\n		return a==root[c][a]?a:root[c][a]=find(c, root[c][a]);\r\n	}\r\n\r\n	bool app[POINT_NUM*2];\r\n\r\n	inline void error(int, int, int);\r\n\r\n	inline int getint(){\r\n		int g= 0, c= getchar();\r\n		while(c == 10 || c == 32) c= getchar();\r\n		if(c == EOF) return -1;\r\n		while(c>=\'0\' && c<=\'9\'){\r\n			g= g*10+c-48;\r\n			c= getchar();\r\n		}\r\n		return g;\r\n	}\r\n\r\n	struct Point{\r\n		int x, y, conv;\r\n		inline void get(){\r\n			x= getint();\r\n			y= getint();\r\n		}\r\n		bool operator<(const Point &b)const{\r\n			return y<b.y || y==b.y && (x<b.x||x==b.x&&conv<b.conv);\r\n		}\r\n	}pnt[2][POINT_NUM], lst[POINT_NUM*4];\r\n\r\n	struct Line{\r\n		int st, ed;\r\n		int order, color;\r\n		Point *tst, *ted;\r\n		inline bool get(int ord, int c, int a, int b){\r\n			order = ord;\r\n			color = c;\r\n			if(pnt[color][a].x < pnt[color][b].x){\r\n				st= a;\r\n				ed= b;\r\n			}else{\r\n				st= b;\r\n				ed= a;\r\n			}\r\n			return 1;\r\n		}\r\n	}line[POINT_NUM*2];\r\n\r\n	bool cmp(Point a, Point b){\r\n		return a.x<b.x;\r\n	}\r\n\r\n	std::set<Point> chk;\r\n\r\n	Point* setLst(int conv, Point &a){\r\n		Point *p= &lst[pCnt++];\r\n		*p= a;\r\n		p->conv= conv;\r\n		return p;\r\n	}\r\n\r\n	inline long long cross(int x1, int y1, int x2, int y2){\r\n		return (long long)x1*y2-(long long)x2*y1;\r\n	}\r\n\r\n	inline long long cross(Point a, Point b, Point c){\r\n	//	printf(\"wanna cross %d %d %d %d %d %d\\n\", a.x, a.y, b.x, b.y, c.x, c.y);\r\n		return cross(b.x-a.x, b.y-a.y, c.x-a.x, c.y-a.y);\r\n	}\r\n\r\n	inline bool crossTest(int a, int b){\r\n		static Point a1, a2, b1, b2;\r\n		static long long c1, c2;\r\n		a1 = pnt[line[a].color][line[a].st];\r\n		a2 = pnt[line[a].color][line[a].ed];\r\n		b1 = pnt[line[b].color][line[b].st];\r\n		b2 = pnt[line[b].color][line[b].ed];\r\n		c1 = cross(a1, b1, b2);\r\n		c2 = cross(a2, b1, b2);\r\n	//	printf(\"%d & %d : c1 %I64d c2 %I64d\\n\", a, b, c1, c2);\r\n		return c1>0&&c2<0 || c1<0&&c2>0;\r\n	}\r\n\r\n	inline void error(int opt, int a, int b){\r\n\r\n		switch(opt){\r\n			case 0:\r\n				puts(\"Error 0 : No such file.\");\r\n				break;\r\n			case 1:\r\n				puts(\"Error 1 : Your output file has more/less line(s) than expected.\");\r\n				printf(\"Expected : %d Line(s)   Received : %d Line(s)\\n\", num[0]+num[1]-2, a);\r\n				break;\r\n			case 2:\r\n				puts(\"Error 2 : Your output file doesn\'t connect all the nodes\");\r\n				printf(\"Node %d (with color : %d) missed.\\n\", a, b);\r\n				break;\r\n			case 3:\r\n				puts(\"Error 3 : One segment crossed another.\");\r\n				printf(\"Segment : %d & %d\\n\", a, b);\r\n				break;\r\n			default:\r\n				puts(\"Unknown Error.\");\r\n		}\r\n		exit(0);\r\n	}\r\n}\r\n\r\nvoid Init(int&gcnt, int&rcnt){\r\n\r\n	//Init\r\n	for(int i=0; i<POINT_NUM; i++)\r\n		ioi06_points::root[0][i]= ioi06_points::root[1][i]= i;\r\n\r\n\r\n	if(ioi06_points::init == 1)ioi06_points::error(0,0,0);\r\n\r\n	ioi06_points::init = 1;\r\n\r\n	for(int i=0; i<2; i++){\r\n		ioi06_points::num[i]= ioi06_points::getint();\r\n		for(int j=1; j<=ioi06_points::num[i]; j++)\r\n			ioi06_points::pnt[i][j].get();\r\n	}\r\n\r\n	gcnt = ioi06_points::num[0];\r\n	rcnt = ioi06_points::num[1];\r\n\r\n	ioi06_points::lineCnt = 1;\r\n\r\n	ioi06_points::getCnt[0] = ioi06_points::getCnt[1] = 1;\r\n}\r\n\r\nvoid Get(int c, int&x, int &y){\r\n	if(ioi06_points::getCnt[c] == ioi06_points::num[c]+1)ioi06_points::error(0,0,0);\r\n	x = ioi06_points::pnt[c][ioi06_points::getCnt[c]].x;\r\n	y = ioi06_points::pnt[c][ioi06_points::getCnt[c]].y;\r\n	ioi06_points::getCnt[c]++;\r\n}\r\n\r\nvoid Report(int c, int a, int b){\r\n\r\n//	printf(\"%d %d %c\\n\", a, b, c==0?\'g\':\'r\');\r\n\r\n	int lineCnt = ioi06_points::lineCnt;\r\n	ioi06_points::line[lineCnt].get(lineCnt, c, a, b);\r\n	int col= ioi06_points::line[lineCnt].color, aa=ioi06_points::line[lineCnt].st, bb=ioi06_points::line[lineCnt].ed;\r\n	ioi06_points::line[lineCnt].tst = ioi06_points::setLst(ioi06_points::lineCnt, ioi06_points::pnt[col][aa]);\r\n	ioi06_points::line[lineCnt].ted = ioi06_points::setLst(ioi06_points::lineCnt, ioi06_points::pnt[col][bb]);\r\n	int ra= ioi06_points::find(col, aa), rb= ioi06_points::find(col, bb);\r\n//	printf(\"connect  %d  %d %d\\n\", col, aa, bb);\r\n	ioi06_points::root[col][ra]= rb;\r\n	ioi06_points::lineCnt++;\r\n}\r\n\r\nvoid Finish(){\r\n\r\n	if(ioi06_points::init == 0)ioi06_points::error(0,0,0);\r\n\r\n	if(ioi06_points::lineCnt != ioi06_points::num[0]+ioi06_points::num[1]-1) ioi06_points::error(1, ioi06_points::lineCnt-1, 0);\r\n\r\n	//Connected\r\n	for(int i=0; i<2; i++){\r\n		int r= ioi06_points::find(i,1);\r\n//		printf(\"root %d\\n\");\r\n		for(int j=1; j<=ioi06_points::num[i]; j++){\r\n//			printf(\"%d\'s root %d\\n\", j, ioi06_points::find(i,j));\r\n			if(r!= ioi06_points::find(i, j))\r\n				ioi06_points::error(2,j,i);\r\n		}\r\n	}\r\n\r\n	//Use A Set to Check.\r\n	std::set<ioi06_points::Point> :: iterator tmp, now, pre, nxt;\r\n	std::sort(ioi06_points::lst, ioi06_points::lst+ioi06_points::pCnt, ioi06_points::cmp);\r\n	ioi06_points::chk.clear();\r\n	for(int i=0; i<ioi06_points::pCnt; i++){\r\n		int con= ioi06_points::lst[i].conv;\r\n		ioi06_points::chk.insert(ioi06_points::lst[i]);\r\n		tmp = ioi06_points::chk.find(ioi06_points::lst[i]);\r\n		now = tmp;\r\n		pre = --tmp;\r\n		tmp++; nxt = ++tmp;\r\n		if(!ioi06_points::app[con]){\r\n			ioi06_points::app[con] = 1;\r\n		}else{\r\n			ioi06_points::app[con] = 0;\r\n		}\r\n\r\n		//Test Cross\r\n		if(pre != ioi06_points::chk.end()){\r\n			if(ioi06_points::crossTest(con, pre->conv) && ioi06_points::crossTest(pre->conv, con))\r\n				ioi06_points::error(3, con, pre->conv);\r\n		}\r\n		if(nxt != ioi06_points::chk.end()){\r\n			if(ioi06_points::crossTest(con, nxt->conv) && ioi06_points::crossTest(nxt->conv, con))\r\n				ioi06_points::error(3, con, nxt->conv);\r\n		}\r\n\r\n		if(!ioi06_points::app[con]){\r\n			ioi06_points::chk.erase(*ioi06_points::line[con].tst);\r\n			ioi06_points::chk.erase(*ioi06_points::line[con].ted);\r\n		}\r\n	}\r\n\r\n	puts(\"XDDDDDDDDDDDDAccepted.\");\r\n}\r\n\r\n\r\n#endif',1631),(1632,'','<img src=\'pimgs/1632.jpg\'>\r\n, ,\r\n,\r\n, .\r\n\r\n, ,\r\n.\r\n\r\n, .\r\n, , .\r\n,\r\n, , .\r\n,  k .\r\n\r\n, , ,\r\n k , .\r\n, .\r\n\r\n?','TIOJ1632 / Problem Setter: worm','2014-08-12 07:00:40','2014-08-12 07:00:40',' n, k. n .\r\n n , .\r\n(1 <=  <= 2 * 10^9)\r\n(2 <= n <= 200000, 1 <= k <= C(n, 2))\r\n\r\n.','.','5 2\r\n9 18 27 28 37\r\n','9