	if(start!=0 && no!=start) exit0(\"Points Not Same\");\r\n		}\r\n		else {\r\n			if(degree[no] %2 == 0) exit0(\"Not Odd Point.\");\r\n			if(used[no]) exit0(\"Point Already Been Used.\");\r\n		}\r\n		used[no] = true;\r\n	}\r\n}\r\n\r\nvoid Init() {\r\n	puts(\"EULER__ATP__INIT!!!!\");\r\n	euler_atp::rtn = scanf(\"%d%d\", &euler_atp::V, &euler_atp::E);\r\n	if(euler_atp::rtn != 2) euler_atp::exit0(\"Input Error (I).\");\r\n\r\n	for(int i=1; i<=euler_atp::E; i++) {\r\n		euler_atp::rtn = scanf(\"%d%d\", &euler_atp::edge[0][i], &euler_atp::edge[1][i]);\r\n		if(euler_atp::edge[0][i] == euler_atp::edge[1][i]) euler_atp::exit0(\"!!!!!!!!!Self Cycle!!!!!!!!!!\");\r\n		if(euler_atp::rtn != 2) euler_atp::exit0(\"Input Error (II).\");\r\n		euler_atp::degree[euler_atp::edge[0][i]] ++;\r\n		euler_atp::degree[euler_atp::edge[1][i]] ++;\r\n	}\r\n	for(int i=1; i<=euler_atp::V; i++) {\r\n		if(euler_atp::degree[i]%2 == 1) euler_atp::oddcnt ++;\r\n	}\r\n}\r\n\r\nvoid GetVE(int&v, int&e) {\r\n	puts(\"G!! VE!!\");\r\n	if(euler_atp::ei != 0) euler_atp::exit0(\"Mult GetVE().\");\r\n	euler_atp::ei = 1;\r\n	v = euler_atp::V;\r\n	e = euler_atp::E;\r\n}\r\n\r\nvoid Get(int&e1, int&e2) {\r\n	if(euler_atp::ei < 1 && euler_atp::ei >= euler_atp::E) euler_atp::exit0(\"Mult Get().\");\r\n	e1 = euler_atp::edge[0][euler_atp::ei];\r\n	e2 = euler_atp::edge[1][euler_atp::ei];\r\n	euler_atp::ei ++;\r\n}\r\n\r\nvoid ReportVst(int no) {\r\n	euler_atp::oddchk(no);\r\n	euler_atp::reportcnt ++;\r\n	euler_atp::start = no;\r\n	if(euler_atp::pre != 0) euler_atp::exit0(\"Mult ReportVst().\");\r\n	euler_atp::pre = no;\r\n}\r\n\r\nvoid ReportVed(int no) {\r\n	euler_atp::oddchk(no);\r\n	if(euler_atp::pre == 0) euler_atp::exit0(\"Mult ReportVed()\");\r\n	if(euler_atp::pre != no) euler_atp::exit0(\"Ved Is Not Correct.\");\r\n	euler_atp::pre = 0;\r\n}\r\n\r\nvoid ReportE(int no) {\r\n	if(no<0 || no>euler_atp::E)euler_atp::exit0(\"Illegal ReportE().\");\r\n	if(euler_atp::eused[no]) euler_atp::exit0(\"Edge Has Been Visited.\");\r\n	if(euler_atp::pre == 0) euler_atp::exit0(\"Not Started.\");\r\n	euler_atp::eused[no] = true;\r\n	if(euler_atp::edge[0][no] == euler_atp::pre) {\r\n		euler_atp::pre = euler_atp::edge[1][no];\r\n	} else if(euler_atp::edge[1][no]){\r\n		euler_atp::pre = euler_atp::edge[0][no];\r\n	} else euler_atp::exit0(\"E Is Not Correct.\");\r\n}\r\n\r\nvoid Final() {\r\n	int need = euler_atp::oddcnt/2;\r\n	if(need == 0) need = 1;\r\n	if(need != euler_atp::reportcnt) euler_atp::exit0(\"Too Many Path(s).\");\r\n	for(int i=1; i<=euler_atp::V; i++) {\r\n		if(euler_atp::degree[i] == 0) euler_atp::exit0(\"!!!!!!!!!Wrong Input!!!!!!!!!!\");\r\n		if(!euler_atp::used[i] && euler_atp::degree[i]%2)\r\n			euler_atp::exit0(\"Some Point(s) Were Not Visited.\");\r\n	}\r\n	for(int i=1; i<=euler_atp::E; i++)\r\n		if(!euler_atp::eused[i])\r\n			euler_atp::exit0(\"Some Edge(s) Were Not Visited.\");\r\n	if(euler_atp::pre != 0) euler_atp::exit0(\"Unfinished.\");\r\n	puts(\"Ya!!!! Final.\"); exit(0);\r\n}\r\n#endif',1692),(1693,'Problem C ','\r\nDBTF\r\nDBTF\r\n\r\n\r\n\r\nm-m-m-monster kill\r\nN\r\n\r\n\r\nHV\r\n\r\nHXYY\r\nVYXX\r\n\r\n<img src=\'pimgs/1693.png\'>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','TIOJ1693 / ABCLS Contest, Problem C','2014-08-12 07:02:01','2014-08-12 07:02:01','NN\r\nNiXi, Yi, Ri, Hi\r\ni(Xi, Yi)RiHi\r\n\r\nN  100\r\n  10,0000\r\n','NiCii\r\n\"so sad\"\r\n\r\n','3\r\n0 0 4 10\r\n10 10 4 10\r\n10 1006 1 1000\r\n','HHV\r\n','HHVVVVHHV\r\n',0,0,NULL,NULL,1693),(1694,'Problem D ','(*)\r\n21\r\n\r\n\r\n\r\n\r\n\r\nRK\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n[L, R](i, j)L  i < j  Rij\r\n\r\n\r\n\r\n','TIOJ1694 / ABCLS Contest, Problem D','2014-08-12 07:02:02','2014-08-12 07:02:02','NQNQ\r\nNHi1  Hi  <font color=\'red\'>N</font>\r\nQLjRj\r\n\r\nN  23,000 Q  200,0001  L  R  N\r\n','Q\r\n','6 3\r\n1 3 2 6 4 5\r\n1 3\r\n2 4\r\n1 6\r\n','1\r\n1\r\n3\r\n','XX\r\n',0,0,NULL,NULL,1694),(1695,'Problem E ','\r\n\r\n\r\n(*)\r\n21(ITO)\r\n21\r\n\r\n\r\n\