INSERT INTO `submissions` VALUES (1,'#include <cstdio>\r\n#include <cstdlib>\r\n#include <iostream>\r\n#include <cstring>\r\n#include <string>\r\n#include <algorithm>\r\n#include <cmath>\r\n#include <queue>\r\n#include <vector>\r\n#include <list>\r\nusing namespace std;\r\n\r\nint ct[20][70000];\r\n\r\nint gohit(int n,int a[],int np,int dead) {\r\n	if(ct[np][dead])\r\n		return ct[np][dead];\r\n	if(dead==(1<<n)-1)\r\n		return ct[np][dead]=(np+a[np])/a[np]*a[np];\r\n	int i;\r\n	ct[np][dead]=2147483647;\r\n	for(i=0; i<n; i++)\r\n		if((dead&(1<<i))==0)\r\n			ct[np][dead]=min(ct[np][dead],(gohit(n,a,i,dead|(1<<i))+abs(np-i)+a[np]-1)/a[np]*a[np]);\r\n	return ct[np][dead];\r\n}\r\n\r\nint main () {\r\n	int n,a[20];\r\n	scanf(\"%d\",&n);\r\n	int i;\r\n	for(i=0; i<n; i++)\r\n		scanf(\"%d\",a+i);\r\n	int ans=2147483647;\r\n	for(i=0; i<n; i++)\r\n		ans=min(ans,gohit(n,a,i,1<<i));\r\n	printf(\"%d\",ans);\r\n}\r\n','c++11','WA',0,'2014-08-12 07:48:15','2014-08-12 07:48:20',1014,4,NULL,'WA/2/3296/WA/1/1192/WA/1/1196/WA/1/1208/WA/1/1184/WA/1/1200/WA/2/3296/WA/17/3772/',26,3772),(2,'include <stdio.h>\r\ninclude \"lib1044.h\"\r\nint main(void)\r\n{\r\n  int n,i,j;\r\n  n = Initialize();\r\n  i = Guess(n);\r\n  if(i==0)\r\n    Report(i+1);\r\n  else\r\n    Report(i-1);\r\n  return 0;\r\n}\r\n','c++11','CE',0,'2014-08-12 10:08:38','2014-08-12 10:08:40',1044,6,NULL,'CE',NULL,NULL),(3,'#include <stdio.h>\r\n#include \"lib1044.h\"\r\nint main(void)\r\n{\r\n  int n,i,j;\r\n  n = Initialize();\r\n  i = Guess(n);\r\n  if(i==0)\r\n    Report(i+1);\r\n  else\r\n    Report(i-1);\r\n  return 0;\r\n}\r\n','c++11','WA',0,'2014-08-12 10:09:57','2014-08-12 10:09:59',1044,6,NULL,'WA/1/508/WA/1/512/WA/1/508/WA/1/512/WA/2/504/',6,512),(4,'#include<cstdio>\r\n#include\"lib1044.h\"\r\n\r\nint main(){\r\n	int ql = 1, qr = Initialize() + 1;\r\n	while(qr - 1 > ql){\r\n		int m = (ql + qr) / 2;\r\n		if(Guess(m) == 0) ql = m + 1;\r\n		else qr = m + 1; \r\n	}\r\n	Report(ql);\r\n}\r\n','c++11','TLE',20,'2014-08-12 10:16:01','2014-08-12 10:16:06',1044,6,NULL,'TLE/1973/464/TLE/1995/468/TLE/1990/468/TLE/1953/468/AC/0/496/',7911,496),(5,'#include<cstdio>\r\n#include\"lib1044.h\"\r\n\r\nint main(){\r\n	int ql = 1, qr = Initialize();\r\n	while(qr != ql){\r\n		int m = (ql + qr) / 2;\r\n		if(Guess(m) == 0) ql = m + 1;\r\n		else qr = m; \r\n	}\r\n	Report(ql);\r\n}\r\n','c++11','AC',100,'2014-08-12 10:16:55','2014-08-12 10:16:57',1044,6,NULL,'AC/1/492/AC/1/496/AC/1/488/AC/2/492/AC/1/488/',6,496);
